import Faceicon from '../myicon/face.svg'
import Igicon from '../myicon/insta.svg'
function Iconsosmed() {
    return (
        <div>
 <img src={Faceicon} alt="gambar tidak tersedia" className="faceicon sosmed"/>
 <img src={Igicon} alt="gambar tidak tersedia" className="igicon sosmed"/>
        </div>
    )
}
export default Iconsosmed;
